import { React, useState } from "react";
import img from "../../../images/svg-10.svg";

import {
  AddWrapper,
  AddText,
  AddImage,
  AddBtnWrapper,
  AddBtn,
  AddTxt,
  TableWrapper,
} from "./AddElements";
import { AiFillFolderAdd } from "react-icons/ai";

const AddData = () => {
  const [file, setfile] = useState(false);

  return (
    <>
      {file ? (
        <AddWrapper>
          <AddBtnWrapper>
            <AddTxt>
              Upload a new dataset, or select one as your primary.
            </AddTxt>
            <AddBtn>
              Upload Data
              <AiFillFolderAdd></AiFillFolderAdd>
            </AddBtn>
          </AddBtnWrapper>
          <AddImage src={img} alt="noyet"></AddImage>
          <AddText>No data imported yet !</AddText>
        </AddWrapper>
      ) : (
        <AddWrapper>
          <AddBtnWrapper>
            <AddTxt>
              Upload a new dataset, or select one as your primary.
            </AddTxt>
            <AddBtn>
              Upload Data
              <AiFillFolderAdd size="20px"></AiFillFolderAdd>
            </AddBtn>
          </AddBtnWrapper>
          <TableWrapper>
            <Table>
            <Name></Name></Table>
          </TableWrapper>
        </AddWrapper>
      )}
    </>
  );
};

export default AddData;
